body.script:
//
      document.addEventListener("DOMContentLoaded", function() {
      var elements = [ document.querySelector('#Header') ];
      elements.forEach(e => {
      e.classList.remove('section');
      })

      var navbarButton = document.querySelector('.navbar-burger');
      var navbar = document.querySelector('.navbar');
      document.addEventListener('scroll', function() {
      if (navbar.getBoundingClientRect().top <= 10 && window.scrollY != 0) {
      navbar.classList.add('is-fixed-top','fade-bottom');
      document.body.classList.add('has-navbar-fixed-top');
      }
      if (window.scrollY == 0)
      {
      navbar.classList.remove('is-fixed-top','fade-bottom');
      document.body.classList.remove('has-navbar-fixed-top');
      }
      });
      navbarButton.addEventListener('click', function() {
      let menu = document.querySelector(this.dataset.target);
      menu.classList.toggle('is-active');
      this.classList.toggle('is-active');
      });
      });
      //
